<script>
    jQuery(document).ready(function ($) {
        $(""#btnAtualizaUsuario"").on(""click"", function (event) {
            if ($(""#frmAtualizacaUsuario"")[0].checkValidity() == false)
                return;
            else {
                event.preventDefault();
                event.stopPropagation();

                const $form = $(""#frmAtualizacaUsuario"");
                const dadosForm = new FormData($form[0]);
                const urlForm = $form.attr(""action"");
                const method = $form.attr(""method"");

                $.ajax({
                    type: method,
                    url: urlForm,
                    data: dadosForm,
                    cache: false,
                    contentType: false,
                    processData: false,
                    beforeSend: function () {
                        $form.find(""button"").html(
                            ""<span class='spinner-border spinner-border-sm' role='status' aria-hidden='true'></span>&nbsp;");
            WriteLiteral(@"Salvar""
                        ).attr(""disabled"", true);
                    },
                    success: function (response) {
                        $form[0].reset();
                        Swal.fire({
                            icon: 'success',
                            title: 'Sucesso!',
                            text: 'Usuário(a) salvo com sucesso'
                        })
                    },
                    error: function (response) {
                        Swal.fire({
                            icon: 'error',
                            title: 'Ops, ocorreu um erro inesperado na atualização do usuário(a)',
                            text: response.responseText
                        })
                    }
                }).always(function (response) {
                    console.log(response);
                    $form.find(""button"").html(""Salvar"").removeAttr(""disabled"");
                });
            }
        });
    });
</script>
